info:
  contact: {email: frikky@shuffler.io, name: '@frikkylikeme', url: 'https://twitter.com/frikkylikeme'}
  description: Automated generation of Proofpoint Proofpoint
  title: Proofpoint Proofpoint
  version: 1.0.0
  x-logo: data:image/png;base64,
openapi: 3.0.2
paths:
  tmp0:
    post:
      description: Decode URLs which have been rewritten by TAP to their original,
        target URL.
      parameters:
      - description: ''
        example: ''
        in: query
        name: URLs
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: Proofpoint Decode URLs
  tmp1:
    post:
      description: Decodes the URLs locally. Supports v1, v2, and v3 URLs.
      parameters:
      - description: Proofpoint URLs to be decoded. Supports v1, v2 and v3.
        example: ''
        in: query
        name: Rewritten URLs
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp1'}
          description: Successful request
      summary: Proofpoint Decode URLS - Offline
  tmp2:
    post:
      description: Returns aggregate forensics for an entire campaign
      parameters:
      - description: ''
        example: ''
        in: query
        name: Campaign ID
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp2'}
          description: Successful request
      summary: Proofpoint Get Forensics By Campaign ID
  tmp3:
    post:
      description: Returns aggregate forensics for the specified threat
      parameters:
      - description: ''
        example: ''
        in: query
        name: Threat ID
        required: true
        schema: {type: string}
      - description: ''
        example: ''
        in: query
        name: Include Campaign Forensics
        required: false
        schema: {type: boolean}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp3'}
          description: Successful request
      summary: Proofpoint Get Forensics By Threat ID
  tmp4:
    post:
      description: Fetch events for clicks to malicious URLs blocked in the specified
        time period
      parameters:
      - description: Get SIEM Logs from X minutes ago, max is 60.
        example: '30'
        in: body
        name: Minutes Ago
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp4'}
          description: Successful request
      summary: Proofpoint SIEM Clicks Blocked
  tmp5:
    post:
      description: Fetch events for clicks to malicious URLs permitted in the specified
        time period
      parameters:
      - description: Get SIEM Logs from X minutes ago, max is 60.
        example: '30'
        in: body
        name: Minutes Ago
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp5'}
          description: Successful request
      summary: Proofpoint SIEM Clicks Permitted
  tmp6:
    post:
      description: Fetch events for messages blocked in the specified time period
        which contained a known threat
      parameters:
      - description: Get SIEM Logs from X minutes ago, max is 60.
        example: '30'
        in: body
        name: Minutes Ago
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp6'}
          description: Successful request
      summary: Proofpoint SIEM Messages Blocked
  tmp7:
    post:
      description: Fetch events for messages delivered in the specified time period
        which contained a known threat
      parameters:
      - description: Get SIEM Logs from X minutes ago, max is 60.
        example: '30'
        in: body
        name: Minutes Ago
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp7'}
          description: Successful request
      summary: Proofpoint SIEM Messages Delivered
